export function getSearchResultsContainerStyle():{}{
    return {backgroundColor:'wheat',
    width:'35%',
    overflowY:'scroll',
    height:'100px',
    marginTop:'0%',
    borderBottomLeftRadius:'8%',
    borderBottomRightRadius:'8%',
    position:'absolute',
    zIndex:1};
}

export function getSearchResultStyle():{}{
    return {textAlign:'center',cursor:'pointer',userSelect:'none'};
}

export function getTextFieldContainerStyle():{}{
    return {marginLeft:'40%',marginTop:'1%',position:'relative'};
}

export function getTextFieldStyle():{}{
    return {width:'35%',height:'10%'};
}

export function getSymbolCardStyle():{}{
